// import { BrowserRouter, Route, Routes } from "re
import { Route, Routes } from 'react-router-dom';
import Home from './routes/home/Home';

function App() {
  return (
    <div>
      <Routes>
        <Route path='/' element={<Home />}/>
        <Route path='/about' element={<Home />}/>
        <Route path='/timeline' element={<Home />}/>
        <Route path='/' element={<Home />}/>
        <Route path='/' element={<Home />}/>
      </Routes>
      {/* <Home /> */}
    </div>
  );
}

export default App;
